    value: 'The negative amount incurred this period of $.30 for the debt to Strategic
      Fundraising reported on Schedule D with a beginning balance of $62,667.25 was
      entered to correct the beginning debt balance that was due. When the debt was
      paid in June, it was discovered that the original balance had been entered incorrectly
      and should have been $62,666.95 instead of $62,667.25 as reported on prior reports.
      The negative disbursements from various news services and one individual are
      not voided checks, they represent payment to the Committee to purchase copies.
      The original operating expenses of the Committee were all paid by the Committee
      as Admin allocated activity and therefore, the purchase of these items is recorded
      as such. The negative disbursement from Ben Albritton Campaign on 6/14/10 represents
      reimbursement to the Committee for telephone expenses that were paid as Admin
      allocated activity in 2010. No expenditure, other than a direct contribution
      or exempt activity so identified, was made on behalf of a specifically identified
      federal candidate. No expenditure not identified as such was for a public communication
      that referred to a clearly identified candidate for Federal office and that
      promoted, supported, attacked or opposed any such candidate for Federal office.
      All expenditures to individuals for rent represent rent income to those individuals
      and arent required to be itemized. All disbursements for salaries and benefits
      disclosed on Schedule H4 are for employees who did not spend more than 25% of
      their compensated time during the reporting period on Fed election activities
      or activities in connection with a Federal election. All transfers for allocated
      activity reported on Sch H3 occurred within the 70-day permitted window of time.
      The Committee uses the Escrow option for receipt of corporate in-kind donations
      as provided for by the Commission in Advisory Opinion 1992-33. The method ensures
      that prohibited sources are not used to fund the federal share of allocable
      activity expenses. In June 2010, it was discovered that an administrative corporate
      in-kind was inadvertently left off of a 2008 report. The appropriate 2008 reports
      have been amended to correctly report that in-kind. The Committee had sufficient
      funds in the escrow account at the time of the in-kind and has maintained a
      combined positive balance since that time.  In-kind details and the escrow account
      activity are summarized as follows:   Admin Acct: 6/1/10 Admin escrow balance
      $75.75   6/1/10 transfer to Admin escrow account of $840.  6/4/10 Yuma Solutions
      in-kind of $4,000 as reflected on Sch H4 and transfer on Sch H3 using $840 of
      escrow balance.  6/30/10 Admin escrow balance of $75.75  6/1/10 and 6/30/10
      MD-10B escrow account balance is $426.64.  COMBINED ESCROW BALANCE OF $502.39.  '
